import React from "react"

const Person = (props) => {
    return (
        <div>
            <p>Name: {props.name}</p>
            <p>Gender: {props.gender}</p>
            {/* <p>Birth Year: {props[birth_year]}</p> */}
            <p>Gender: {props.gender}</p>
            <p>Species: {props.species.map(ele=> `${ele},`)}</p>
            <p>Home World: {props.homeworld}</p>
            <p>Films: {props.films.map(ele=> `${ele},`)}</p>
        </div>
    )
}

export default Person
